import React, { useState } from "react";
import blogContext from "../context/blogs/BlogContext";

export default function UserData() {
    const context = useState(blogContext)
    const { blogs, setBlogs } = context
    return (
        <>
            <h1>Your Blogs</h1>
            {blogs.map(blog => {
                return blog.title;
            })}
        </>
    )
}
